# **Intro**

1. In 1932, the constructivist architecture was replaced by the Stalinist architecture (Khan-Magomedov, 1996; Paperny, 1985; Khmelnitsky, 2007; Groys, 2011).

2. The goal is to study the cultural production under the different state regimes.

]

# **Networks and creative collaborations**

&lt;div style="font-size:25pt"&gt;

- Architects form an **occupational group that was unnoticed by sociologists** for a long time (Blau, 1987);
- Recent attention to the **networks as a tool** for the studies of architects (Ermoshin, 2017; Matos &amp; Ramos, 2017).
&lt;br&gt;
&lt;br&gt;
- Collaboration structure &amp; team performance:&lt;br&gt;**Team assembly mechanisms**(Guimera et. al. 2005)&lt;br&gt;**core/periphery** (Cattani &amp; Ferriani, 2008).
&lt;br&gt;
&lt;br&gt;
- Conditions for the field predisposition for innovations&lt;br&gt;**Small world problem**(Uzzi &amp; Spiro, 2005)


---

# **Power relations**

&lt;div style="font-size:25pt"&gt;

- Personal participation of Joseph Stalin in the field change (Khmelnitsky, 2007) – not only in architecture (Paperny, 1985).


- Creativity appears in the social context that enables an idea to be creative (Csikszentmihalyi, 1997). It is not enough for an artist to be talented; he/she should be perceived by the powerful field members as such.


- Artistic production is located inside the field of power relations (Bourdieu, 1983, 1996) – architects struggled for the limited number of places in favor of authorities.

---

## **RQs**

&lt;div style="font-size:20pt"&gt;

- How did the collaboration network developed throughout the decades?

- How the structural positions influenced the one's consecration?


## **Goals**

- to contribute the discussion around the style shift by providing the meso-level arguments.

- to reveal the dynamics of innovation flows in totalitarian context of cultural production.

- to quantitatively analyze the factors behind architects' consecration.

# **Variables**


**Dependent variable**: recognition in that time:
 
1. number of appearances as author or article's hero in `\(\color{darkgreen}{\text{prof. journal}}\)` (“Arkhitektura Leningrada”, “Arkhitektura SSSR”)&lt;/span&gt;;
2. number of buildings in the `\(\color{orange}{\text{list of cultural heritage}}\)`;
3. number of appearances in `\(\color{red}{\text{newspapers}}\)` ("Izvestiya", "Pravda") via EastView.

.center[![](newspapers screenshots/architecture_1941_03_2.png)&lt;br&gt;
*Leningrad Architecture*, 1941-03
]

---

# **Variables**

**Independent variables**: number of unique partners, temporal betweenness.

**Control variables**: age, studio affiliation (1936), participation in Avant-garde, pre-revolutionary experience, Leningrad Union of Architects board membership (1940 and 1945), numbers of individual and collaborative projects.
